      paragraph: " Noqa wajcha purishani juchasniyta apaspa. Qhespiyniyta mask'ashani kay pachapi musphaspa. \n Mayllamanchus qayllashani samakuyta mask'aspa. \n Ñawismanta tutayani chinkasqayta waqaspa.", //TODO: (3)
