      paragraph: " /Maravilla es el Señor, maravilla es el Señor. Poderoso es el Señor de los señores./ \n Dame más poder, dame más poder. \n Dame más, dame más tu poder.\n Para predicar, para predicar, \n Para predicar más de tu amor.", //TODO: (5)
