      paragraph: " /Diosniy Tatayqa khuyakuyniyoj \n Sajra kayniyta Pay llimphuchawan. \n Jucha chawpipi kawsasharqani,\n Contraykipitaj juchallerqani. \n Ñawpaqeykipi mana allin kayta perdonaway./", //TODO: (5)
