      paragraph: " /Sonqoykita llamp'uchay, Señorman chimpaykukuy. \n Munakoj Dios Tatanchej khuyaykusonqa./ /Sinch'i kusikuyninta sonqoykiman churanqa, Qanwan wifiaypaj kanqa Dios Tatanchejqa/", //(2)
