      paragraph: " /Con mi vida nueva ¡oh hermanos! yo voy a brillar./\nAhora soy nuevo ser, porque Dios me cambió, \n Con su gran poder./ \n /Mi anhelo es vivir sólo para mi Dios,\n De este mundo no soy./", //TODO: (4)
