      paragraph: " Tarpuy paqarimpi Diospa Palabranta\nChawpi p'unchaypipis, ch'isiyaypipis.\nChajra oqhariypaj tiempo chamojtintaj,\nPoqosqaña kajtin, oqharisunchej.", //(1)
