      paragraph: " Cristo Salvadorniytaqa, Payllata munakusaj;\nJuchayojman willamusaj chay munakuyninmanta.\nCruzpi wañusqanmantapis, janaj pachamantapis.\nTakimusaj angeleswan, Diosllata yupaychaspa.", //TODO: (1)
