      paragraph: " Jesusta tukuy qhatejkuna renqanku cieloman.\nKusiy pillusta jap'enqanku; qanpaj kanqa noqapajpis.\nK'anchay gloriampi Jesús kashan chaypi nanay tukukaponqa.\nPischus chaypi kamonqanku. Qampis rinki, noqa risaj.", //(1)
