      chorusPos: [],
      paragraph: " Wiñay kawsayta jap'enqanku cielopi wiñaypaj\nTata Diosman kawsayninta qoj. Qanpaj kanchu noqapajri?\nKaypi tukusaj llank'anayta Jesusniypa yanapayninwan\nChaypeqa wiñaypaj kusiy kanqa. Qanpaj kanqa    noqapajpis. \n Francas las puertas encontrarán, unos sí; otros no.\nDe alguien las glorias serán sin fin /¿y tú? ¿y yo?/\n&quot;Calles de oro&quot;, mar de cristal, Pleno reposo, perfecto amor;\nunos    tendrán celestial hogar, /¿y tú? ¿y yo?/ \n Fieles discípulos de Jesús, unos si; otros no;\n Logran corona en vez de cruz, /¿y tú? ¿y yo?/ \n Mora el Señor en gloriosa luz; Con El no puede haber dolor; \n De alguien es esta beatitud, /¿y tú? ¿y yo?/", //TODO: (6)
