      paragraph: " Llegan a tiempo pasando bien; unos sí, otros no; \n Unos las puertas cerradas ven /¿y tú? ¿y yo?/ \n Ciegos y sordos hoy nada creen.Tarde lamentarán tal error\n El que desdeña será su juez; /¿y tú? ¿y yo?!", //TODO: (4)
